import React from 'react';
import {Button} from 'react-bootstrap'


const MyComponent = () => {
    return (
        <div className="container">
            <div className="row">
                <div className="col-xl-6">
                    <p>Первая колонка</p>
                </div>
                <div className="col-xl-6">
                    <p>Вторая колонка</p>
                </div>
            </div>
        </div>
    );
};

export default MyComponent;
